    false,nt"url": null,nt"notes": "The purpose of the Ottawa NWR Integrated
    Pest Management plan (IPM) is to provide a plan and a tool for adaptive management
    of invasive species on the Refuge. The Ottawa NWR Complex Integrative Pesticide
    Management Plan (IPM) incorporates new knowledge gained from current research, new
    control techniques, and advancement in equipment to create a management plan for
    invasive species as well as to address effects of climate change. The plan includes
    a list of invasive species on Refuge property, followed by methods and history of
    pesticide treatment and best management practices.",nt"license_title": "License
